        if (x, y, length) in visited:
            continue
        visited.add((x, y, length))
        if length == k:
            return path
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                new_path = path + [grid[nx][ny]]
                heappush(pq, (cost, length + 1, nx, ny, new_path))

def tri(n):
    if n == 0:
        return [1]
    if n == 1:
        return [1, 3]
    trib = [1, 3]
    for i in range(2, n + 1):
        if i % 2 == 0:
            trib.append(1 + i / 2)
        else:
            trib.append(trib[i - 1] + trib[i - 2] + trib[i - 1])
    return trib

def digits(n):
